import logo from '../logo.svg';
import '../App.css';
import Navbar from '../Navbar/Navbar';

function Messagerie() {
    const [posts, setPosts] = useState([]);
    useEffect(() => {
      axios
        .get('http://localhost:3000/posts')
        .then(res => {
          console.log(res);
          setPosts(res.data);
        })
        .catch(err => {
          console.log(err);
        });
    }, []);
    return (
      <div className="App">
        <Navbar />
        <nav className="navbar" style={{ backgroundColor: 'green' }}>

          <a href="#" className="navbar-item">Utilisateur 1</a>
          <a href="#" className="navbar-item">Utilisateur 2</a>
          <a href="#" className="navbar-item">Utilisateur 3</a>
          <a href="#" className="navbar-item">Utilisateur 4</a>
          <a href="#" className="navbar-item">Utilisateur 5</a>
        </nav>
        <p>C les messages</p>
      </div>
    );
  }
  

export default Messagerie;
